from typing import List, Dict, Tuple
class Solution:
    def __init__(self):
        self.prefix_sum: List[List[int]] = None
    def init(self, mat: List[List[int]], m, n) -> None:
        self.prefix_sum = [[0] * (n + 1) for _ in range(m + 1)]
        for i in range(m):
            for j in range(n):
                self.prefix_sum[i][j] = mat[i][j] + self.prefix_sum[i - 1][j] + self.prefix_sum[i][j - 1] - self.prefix_sum[i - 1][j - 1]
    def matrix_sum(self, x: int, y: int, w: int) -> int:
        return self.prefix_sum[x + w][y + w] - self.prefix_sum[x][y + w] - self.prefix_sum[x + w][y] + self.prefix_sum[x][y]
    def maxSideLength(self, mat: List[List[int]], threshold: int) -> int:
        m, n = len(mat), len(mat[0])
        self.init(mat, m, n)
        l, r = 1, min(m, n) + 1

        def check(k):
            for i in range(0, m - k + 1):
                for j in range(0, n - k + 1):
                    if self.matrix_sum(i, j, k) <= threshold:
                        return True
            return False

        ans = 0
        while l < r:
            k = (l + r) // 2
            if check(k):
                ans = k
                l = k + 1
            else:
                r = k
        return ans

